(1, '2021-09-12 19:02:23', 1, '2021-08-20 16:31:45', 1, 1, NULL, 'Y', NULL, NULL, 100, 'Сервис Easyride', 1, '', 'text', NULL, '', 'text', 'СЕРВИС EASYRIDE\r\n\r\n', 1, NULL, NULL, NULL, NULL, NULL, 'N', '1', '', '', '0', NULL, NULL, NULL),
(2, '2021-08-20 16:33:01', 1, '2021-08-20 16:32:43', 1, 1, NULL, 'Y', NULL, NULL, 200, 'Обычный сервис', 3, '', 'text', NULL, '', 'text', 'ОБЫЧНЫЙ СЕРВИС\r\n\r\n', 1, NULL, NULL, NULL, NULL, NULL, 'N', '2', '', '', '0', NULL, NULL, NULL),
(3, '2021-09-12 16:46:55', 1, '2021-08-23 09:15:30', 1, 2, NULL, 'Y', NULL, NULL, 100, 'Работаем во всех регионах России', 5, 'Наша сеть партнеров позволяет нам работать на все территории РФ.  Теперь клиент  в каждом регионе страны может воспользоваться нашими услугами по ремонту агрегатов. Настроенная система логистика позволяет выполнять ремонт в очень сжатые сроки.', 'text', NULL, '', 'text', 'РАБОТАЕМ ВО ВСЕХ РЕГИОНАХ РОССИИ\r\nНАША СЕТЬ ПАРТНЕРОВ ПОЗВОЛЯЕТ НАМ РАБОТАТЬ НА ВСЕ ТЕРРИТОРИИ РФ.  ТЕПЕРЬ КЛИЕНТ  В КАЖДОМ РЕГИОНЕ СТРАНЫ МОЖЕТ ВОСПОЛЬЗОВАТЬСЯ НАШИМИ УСЛУГАМИ ПО РЕМОНТУ АГРЕГАТОВ. НАСТРОЕННАЯ СИСТЕМА ЛОГИСТИКА ПОЗВОЛЯЕТ ВЫПОЛНЯТЬ РЕМОНТ В ОЧЕНЬ СЖАТЫЕ СРОКИ.\r\n', 1, NULL, NULL, NULL, NULL, NULL, 'N', '3', '', '', '0', NULL, NULL, NULL),
(4, '2021-09-12 16:44:58', 1, '2021-08-23 09:15:59', 1, 2, NULL, 'Y', NULL, NULL, 200, 'Сертифицированные специалисты', 6, 'Наша компания уделяет большое внимание обучению сотрудников. У нас выработана своя учебная система и внутрення сертификация сотрудников. ', 'text', NULL, '', 'text', 'СЕРТИФИЦИРОВАННЫЕ СПЕЦИАЛИСТЫ\r\nНАША КОМПАНИЯ УДЕЛЯЕТ БОЛЬШОЕ ВНИМАНИЕ ОБУЧЕНИЮ СОТРУДНИКОВ. У НАС ВЫРАБОТАНА СВОЯ УЧЕБНАЯ СИСТЕМА И ВНУТРЕННЯ СЕРТИФИКАЦИЯ СОТРУДНИКОВ. \r\n', 1, NULL, NULL, NULL, NULL, NULL, 'N', '4', '', '', '0', NULL, NULL, NULL),
(5, '2021-09-12 16:43:09', 1, '2021-08-23 09:19:15', 1, 2, NULL, 'Y', NULL, NULL, 300, 'Самое современное оборудование в РФ', 7, 'Наше оборудование является нашей гордостью. Часть мы закупаем его у поставщиков зарубежом, часть производим сами. Большая часть оборудования работает на проверку готовой продукции, что позволяет нам давать гарантию на более длительный срок.', 'text', NULL, '', 'text', 'САМОЕ СОВРЕМЕННОЕ ОБОРУДОВАНИЕ В РФ\r\nНАШЕ ОБОРУДОВАНИЕ ЯВЛЯЕТСЯ НАШЕЙ ГОРДОСТЬЮ. ЧАСТЬ МЫ ЗАКУПАЕМ ЕГО У ПОСТАВЩИКОВ ЗАРУБЕЖОМ, ЧАСТЬ ПРОИЗВОДИМ САМИ. БОЛЬШАЯ ЧАСТЬ ОБОРУДОВАНИЯ РАБОТАЕТ НА ПРОВЕРКУ ГОТОВОЙ ПРОДУКЦИИ, ЧТО ПОЗВОЛЯЕТ НАМ ДАВАТЬ ГАРАНТИЮ НА БОЛЕЕ ДЛИТЕЛЬНЫЙ СРОК.\r\n', 1, NULL, NULL, NULL, NULL, NULL, 'N', '5', '', '', '0', NULL, NULL, NULL),
(6, '2021-09-12 16:39:52', 1, '2021-08-23 09:19:44', 1, 2, NULL, 'Y', NULL, NULL, 400, 'Ремонт по заводским стандартам', 8, 'Наши стандарты ремонта агрегатов максимально схожи с заводскими требованиями к новым изделиям. Это выгодно отличает нас от конкурентов.  Мы считаем что только высокие стандарты помогут нам предоставить такое качество сервиса, которое устроит требовательных клиентов.', 'text', NULL, '', 'text', 'РЕМОНТ ПО ЗАВОДСКИМ СТАНДАРТАМ\r\nНАШИ СТАНДАРТЫ РЕМОНТА АГРЕГАТОВ МАКСИМАЛЬНО СХОЖИ С ЗАВОДСКИМИ ТРЕБОВАНИЯМИ К НОВЫМ ИЗДЕЛИЯМ. ЭТО ВЫГОДНО ОТЛИЧАЕТ НАС ОТ КОНКУРЕНТОВ.  МЫ СЧИТАЕМ ЧТО ТОЛЬКО ВЫСОКИЕ СТАНДАРТЫ ПОМОГУТ НАМ ПРЕДОСТАВИТЬ ТАКОЕ КАЧЕСТВО СЕРВИСА, КОТОРОЕ УСТРОИТ ТРЕБОВАТЕЛЬНЫХ КЛИЕНТОВ.\r\n', 1, NULL, NULL, NULL, NULL, NULL, 'N', '6', '', '', '0', NULL, NULL, NULL),
(7, '2021-08-23 09:44:20', 1, '2021-08-23 09:20:35', 1, 2, NULL, 'Y', NULL, NULL, 600, 'Гарантия 1-5 лет', 9, '<div class=\"t1\">Гарантия <span>1-5 лет</span></div>\r\n                <div class=\"t2\">при условии пробега <br> до 20 000 км</div>', 'html', 10, '', 'text', 'ГАРАНТИЯ 1-5 ЛЕТ\r\nГАРАНТИЯ 1-5 ЛЕТ \r\nПРИ УСЛОВИИ ПРОБЕГА \r\nДО 20 000 КМ\r\n', 1, NULL, NULL, NULL, NULL, NULL, 'N', '7', '', '', '0', NULL, NULL, NULL),
(8, '2021-09-12 19:20:40', 1, '2021-08-23 10:13:00', 1, 3, NULL, 'Y', NULL, NULL, 100, 'Ремонт пневмобаллонов', NULL, 'от 8 900 р.', 'text', NULL, '', 'text', 'РЕМОНТ ПНЕВМОБАЛЛОНОВ\r\nОТ 8 900 Р.\r\n', 1, NULL, NULL, NULL, NULL, NULL, 'N', '8', '', '', '0', NULL, NULL, NULL),
(9, '2021-09-12 19:10:53', 1, '2021-08-23 10:13:07', 1, 3, NULL, 'Y', NULL, NULL, 200, 'Диагностика', NULL, 'Бесплатно', 'text', NULL, '', 'text', 'ДИАГНОСТИКА\r\nБЕСПЛАТНО\r\n', 1, NULL, NULL, NULL, NULL, NULL, 'N', '9', '', '', '0', NULL, NULL, NULL),
