(15, '2021-09-12 20:47:36', 1, '2021-08-23 10:18:59', 1, 4, NULL, 'Y', NULL, NULL, 500, 'Какие основные симптомы неисправной АКПП?', NULL, 'Какие основные симптомы неисправной коробки?', 'html', NULL, 'Симптомов множество: вибрации во время  движения; стуки в районе расположения АКПП, пропуск или отсутствие отдельных передач, полное обездвиживание автомобиля, загорание контрольной лампы на приборной панели.', 'html', 'КАКИЕ ОСНОВНЫЕ СИМПТОМЫ НЕИСПРАВНОЙ АКПП?\r\nКАКИЕ ОСНОВНЫЕ СИМПТОМЫ НЕИСПРАВНОЙ КОРОБКИ?\r\nСИМПТОМОВ МНОЖЕСТВО: ВИБРАЦИИ ВО ВРЕМЯ \r\nДВИЖЕНИЯ; СТУКИ В РАЙОНЕ РАСПОЛОЖЕНИЯ АКПП, ПРОПУСК ИЛИ ОТСУТСТВИЕ ОТДЕЛЬНЫХ ПЕРЕДАЧ, ПОЛНОЕ ОБЕЗДВИЖИВАНИЕ АВТОМОБИЛЯ, ЗАГОРАНИЕ КОНТРОЛЬНОЙ ЛАМПЫ НА ПРИБОРНОЙ ПАНЕЛИ.', 1, NULL, NULL, NULL, NULL, NULL, 'N', '15', '', '', '0', NULL, NULL, NULL),
(40, '2021-09-12 17:14:53', 1, '2021-08-23 11:04:32', 1, 6, NULL, 'N', NULL, NULL, 500, 'Главная', NULL, ' <p>\r\n                       1111111 выполнит ремонт, диагностику автоматических коробок передач. Специалисты сервиса обслуживают АКПП и CVT, проводят замену коробки на контрактную.\r\n                        <br><br>\r\n                        Сервисный центр на Дзержинского отремонтирует коробку АКПП и вариатор Японских, Корейских, Немецких, Французских автомобилей любой сложности с гарантией.\r\n                        <br><br>\r\n                        Многолетний опыт автомехаников нашего сервиса позволяет устранять неисправности (восстановление) всех типов АКПП и вариаторов после неквалифицированного ремонта краснодарских «горе-мастеров». Мы бесплатно консультируем владельцев автомобилей с автоматической коробкой передач по телефону. Ремонт гидротрансформаторов, запчасти для автоматов любых типов в наличии и под заказ.\r\n                    </p>', 'html', NULL, '', 'text', 'ГЛАВНАЯ\r\n1111111 ВЫПОЛНИТ РЕМОНТ, ДИАГНОСТИКУ АВТОМАТИЧЕСКИХ \r\nКОРОБОК ПЕРЕДАЧ. СПЕЦИАЛИСТЫ СЕРВИСА ОБСЛУЖИВАЮТ АКПП И CVT, ПРОВОДЯТ ЗАМЕНУ КОРОБКИ НА КОНТРАКТНУЮ. \r\n\r\nСЕРВИСНЫЙ ЦЕНТР НА ДЗЕРЖИНСКОГО ОТРЕМОНТИРУЕТ \r\nКОРОБКУ АКПП И ВАРИАТОР ЯПОНСКИХ, КОРЕЙСКИХ, НЕМЕЦКИХ, ФРАНЦУЗСКИХ АВТОМОБИЛЕЙ ЛЮБОЙ СЛОЖНОСТИ С ГАРАНТИЕЙ. \r\n\r\nМНОГОЛЕТНИЙ ОПЫТ АВТОМЕХАНИКОВ НАШЕГО \r\nСЕРВИСА ПОЗВОЛЯЕТ УСТРАНЯТЬ НЕИСПРАВНОСТИ (ВОССТАНОВЛЕНИЕ) ВСЕХ ТИПОВ АКПП И ВАРИАТОРОВ ПОСЛЕ НЕКВАЛИФИЦИРОВАННОГО РЕМОНТА КРАСНОДАРСКИХ «ГОРЕ-МАСТЕРОВ». МЫ БЕСПЛАТНО КОНСУЛЬТИРУЕМ ВЛАДЕЛЬЦЕВ АВТОМОБИЛЕЙ С АВТОМАТИЧЕСКОЙ КОРОБКОЙ ПЕРЕДАЧ ПО ТЕЛЕФОНУ. РЕМОНТ ГИДРОТРАНСФОРМАТОРОВ, ЗАПЧАСТИ ДЛЯ АВТОМАТОВ ЛЮБЫХ ТИПОВ В НАЛИЧИИ И ПОД ЗАКАЗ.\r\n', 1, NULL, NULL, NULL, NULL, NULL, 'N', '40', '', '', '0', NULL, NULL, NULL),
