(2753045, '2021-09-12 18:58:29', 1, '2021-08-25 11:10:27', 1, 9, NULL, 'Y', NULL, NULL, 500, 'Контакты', 37, '<b>Цель, “EazyRide”</b> - избавить клиентов от всех забот, связанных со сложным ремонтом автомобильных агрегатов', 'html', NULL, '<p>\r\n	 Компания основана в&nbsp;2020 году. Основной целью компании является оказание услуг по ремонту автомобильных&nbsp;агрегатов для существующих &nbsp;автосервисных центров.<br>\r\n</p>\r\n<p>\r\n	 В&nbsp;компании &nbsp;более 100 человек: инженеры по ремонту,&nbsp;менеджеры по продажам и&nbsp;ведению клиентов, программисты и маркетологи. Eazyride сейчас активно подготавливаем учебную базу для обучения не только своих,&nbsp;но и сторонних сотрудников.&nbsp;\r\n</p>', 'html', 'КОНТАКТЫ\r\nЦЕЛЬ, “EAZYRIDE” - ИЗБАВИТЬ КЛИЕНТОВ ОТ ВСЕХ \r\nЗАБОТ, СВЯЗАННЫХ СО СЛОЖНЫМ РЕМОНТОМ АВТОМОБИЛЬНЫХ АГРЕГАТОВ\r\nКОМПАНИЯ ОСНОВАНА В&NBSP;2020 ГОДУ. ОСНОВНОЙ \r\nЦЕЛЬЮ КОМПАНИИ ЯВЛЯЕТСЯ ОКАЗАНИЕ УСЛУГ ПО РЕМОНТУ АВТОМОБИЛЬНЫХ&NBSP;АГРЕГАТОВ ДЛЯ СУЩЕСТВУЮЩИХ &NBSP;АВТОСЕРВИСНЫХ ЦЕНТРОВ.\r\n \r\n\r\nВ&NBSP;КОМПАНИИ &NBSP;БОЛЕЕ 100 ЧЕЛОВЕК: ИНЖЕНЕРЫ \r\nПО РЕМОНТУ,&NBSP;МЕНЕДЖЕРЫ ПО ПРОДАЖАМ И&NBSP;ВЕДЕНИЮ КЛИЕНТОВ, ПРОГРАММИСТЫ И МАРКЕТОЛОГИ. EAZYRIDE СЕЙЧАС АКТИВНО ПОДГОТАВЛИВАЕМ УЧЕБНУЮ БАЗУ ДЛЯ ОБУЧЕНИЯ НЕ ТОЛЬКО СВОИХ,&NBSP;НО И СТОРОННИХ СОТРУДНИКОВ.&NBSP;', 1, NULL, NULL, NULL, NULL, NULL, 'N', '2753045', '', '', '0', NULL, NULL, NULL),
