(2753051, '2021-09-12 20:27:49', 1, '2021-08-25 14:32:30', 1, 30, NULL, 'Y', NULL, NULL, 100, 'Ремонт АКПП', NULL, 'Начните оформлять разовую уборку: введите дату и время, параметры квартиры, привяжите карту, а в конце выберите подходящий вариант регулярности подписки на уборки. После этого в разделе «Мои заказы» вы увидите 4 ближайшие уборки со скидкой. Подписка продлевается автоматически, но каждая уборка оплачивается отдельно.', 'text', NULL, 'Начните оформлять разовую уборку: введите дату и время, параметры квартиры, привяжите карту, а в конце выберите подходящий вариант регулярности подписки на уборки. После этого в разделе «Мои заказы» вы увидите 4 ближайшие уборки со скидкой. Подписка продлевается автоматически, но каждая уборка оплачивается отдельно. Начните оформлять разовую уборку: введите дату и время, параметры квартиры, привяжите карту, а в конце выберите подходящий вариант регулярности подписки на уборки. После этого в разделе «Мои заказы» вы увидите 4 ближайшие уборки со скидкой. Подписка продлевается автоматически, но каждая уборка оплачивается отдельно. Начните оформлять разовую уборку: введите дату и время, параметры квартиры, привяжите карту, а в конце выберите подходящий вариант регулярности подписки на уборки. После этого в разделе «Мои заказы» вы увидите 4 ближайшие уборки со скидкой. Подписка продлевается автоматически, но каждая уборка оплачивается отдельно. ', 'text', 'РЕМОНТ АКПП\r\nНАЧНИТЕ ОФОРМЛЯТЬ РАЗОВУЮ УБОРКУ: ВВЕДИТЕ ДАТУ И ВРЕМЯ, ПАРАМЕТРЫ КВАРТИРЫ, ПРИВЯЖИТЕ КАРТУ, А В КОНЦЕ ВЫБЕРИТЕ ПОДХОДЯЩИЙ ВАРИАНТ РЕГУЛЯРНОСТИ ПОДПИСКИ НА УБОРКИ. ПОСЛЕ ЭТОГО В РАЗДЕЛЕ «МОИ ЗАКАЗЫ» ВЫ УВИДИТЕ 4 БЛИЖАЙШИЕ УБОРКИ СО СКИДКОЙ. ПОДПИСКА ПРОДЛЕВАЕТСЯ АВТОМАТИЧЕСКИ, НО КАЖДАЯ УБОРКА ОПЛАЧИВАЕТСЯ ОТДЕЛЬНО.\r\nНАЧНИТЕ ОФОРМЛЯТЬ РАЗОВУЮ УБОРКУ: ВВЕДИТЕ ДАТУ И ВРЕМЯ, ПАРАМЕТРЫ КВАРТИРЫ, ПРИВЯЖИТЕ КАРТУ, А В КОНЦЕ ВЫБЕРИТЕ ПОДХОДЯЩИЙ ВАРИАНТ РЕГУЛЯРНОСТИ ПОДПИСКИ НА УБОРКИ. ПОСЛЕ ЭТОГО В РАЗДЕЛЕ «МОИ ЗАКАЗЫ» ВЫ УВИДИТЕ 4 БЛИЖАЙШИЕ УБОРКИ СО СКИДКОЙ. ПОДПИСКА ПРОДЛЕВАЕТСЯ АВТОМАТИЧЕСКИ, НО КАЖДАЯ УБОРКА ОПЛАЧИВАЕТСЯ ОТДЕЛЬНО. НАЧНИТЕ ОФОРМЛЯТЬ РАЗОВУЮ УБОРКУ: ВВЕДИТЕ ДАТУ И ВРЕМЯ, ПАРАМЕТРЫ КВАРТИРЫ, ПРИВЯЖИТЕ КАРТУ, А В КОНЦЕ ВЫБЕРИТЕ ПОДХОДЯЩИЙ ВАРИАНТ РЕГУЛЯРНОСТИ ПОДПИСКИ НА УБОРКИ. ПОСЛЕ ЭТОГО В РАЗДЕЛЕ «МОИ ЗАКАЗЫ» ВЫ УВИДИТЕ 4 БЛИЖАЙШИЕ УБОРКИ СО СКИДКОЙ. ПОДПИСКА ПРОДЛЕВАЕТСЯ АВТОМАТИЧЕСКИ, НО КАЖДАЯ УБОРКА ОПЛАЧИВАЕТСЯ ОТДЕЛЬНО. НАЧНИТЕ ОФОРМЛЯТЬ РАЗОВУЮ УБОРКУ: ВВЕДИТЕ ДАТУ И ВРЕМЯ, ПАРАМЕТРЫ КВАРТИРЫ, ПРИВЯЖИТЕ КАРТУ, А В КОНЦЕ ВЫБЕРИТЕ ПОДХОДЯЩИЙ ВАРИАНТ РЕГУЛЯРНОСТИ ПОДПИСКИ НА УБОРКИ. ПОСЛЕ ЭТОГО В РАЗДЕЛЕ «МОИ ЗАКАЗЫ» ВЫ УВИДИТЕ 4 БЛИЖАЙШИЕ УБОРКИ СО СКИДКОЙ. ПОДПИСКА ПРОДЛЕВАЕТСЯ АВТОМАТИЧЕСКИ, НО КАЖДАЯ УБОРКА ОПЛАЧИВАЕТСЯ ОТДЕЛЬНО. ', 1, NULL, NULL, NULL, NULL, NULL, 'N', '2753051', 'remont-akpp', '', '0', NULL, NULL, NULL),
(2753052, '2021-09-12 20:30:18', 1, '2021-08-26 10:31:45', 1, 30, NULL, 'Y', NULL, NULL, 200, 'Ремонт пневмоподвески', NULL, 'Быстро и качественно отремонтируем пневмоподвеску и ее элементы:&nbsp;пневмобаллоны,&nbsp;пневмостойки,&nbsp;пневмокомпрессоры и&nbsp;газо-масляные амортизаторы.', 'html', NULL, 'Быстро и качественно отремонтируем пневмоподвеску и ее элементы: пневмобаллоны, пневмостойки, пневмокомпрессоры и газо-масляные амортизаторы. У нас имеется свое производство пневмобаллонов и стоек.  На все работы даем собственную гарантию.', 'text', 'РЕМОНТ ПНЕВМОПОДВЕСКИ\r\nБЫСТРО И КАЧЕСТВЕННО ОТРЕМОНТИРУЕМ ПНЕВМОПОДВЕСКУ \r\nИ ЕЕ ЭЛЕМЕНТЫ:&NBSP;ПНЕВМОБАЛЛОНЫ,&NBSP;ПНЕВМОСТОЙКИ,&NBSP;ПНЕВМОКОМПРЕССОРЫ И&NBSP;ГАЗО-МАСЛЯНЫЕ АМОРТИЗАТОРЫ.\r\nБЫСТРО И КАЧЕСТВЕННО ОТРЕМОНТИРУЕМ ПНЕВМОПОДВЕСКУ И ЕЕ ЭЛЕМЕНТЫ: ПНЕВМОБАЛЛОНЫ, ПНЕВМОСТОЙКИ, ПНЕВМОКОМПРЕССОРЫ И ГАЗО-МАСЛЯНЫЕ АМОРТИЗАТОРЫ. У НАС ИМЕЕТСЯ СВОЕ ПРОИЗВОДСТВО ПНЕВМОБАЛЛОНОВ И СТОЕК.  НА ВСЕ РАБОТЫ ДАЕМ СОБСТВЕННУЮ ГАРАНТИЮ.', 1, NULL, NULL, NULL, NULL, NULL, 'N', '2753052', 'remont-pnevmopodveski', '', '0', NULL, NULL, NULL),
(2753053, '2021-09-12 20:45:56', 1, '2021-08-26 10:31:55', 1, 30, NULL, 'Y', NULL, NULL, 300, 'Ремонт турбин', NULL, 'Сломалась турбина? Это еще не повод покупать новую, есть возможность отремонтировать и восстановить текущую турбину сэкономя на этом хорошие деньги. Мы ремонтируем турбины как легковых автомобилей так и грузовых, коммерческих автомобилей.<br>', 'html', NULL, 'Сломалась турбина? Это еще не повод покупать новую, есть возможность отремонтировать и восстановить текущую турбину сэкономя на этом хорошие деньги. Мы ремонтируем турбины как легковых автомобилей так и грузовых, коммерческих автомобилей. &nbsp;Данный вид ремонта занимает не более 1 дня. &nbsp;Работы включают в себя диагностику и ремонт агрегата.&nbsp;', 'html', 'РЕМОНТ ТУРБИН\r\nСЛОМАЛАСЬ ТУРБИНА? ЭТО ЕЩЕ НЕ ПОВОД ПОКУПАТЬ \r\nНОВУЮ, ЕСТЬ ВОЗМОЖНОСТЬ ОТРЕМОНТИРОВАТЬ И ВОССТАНОВИТЬ ТЕКУЩУЮ ТУРБИНУ СЭКОНОМЯ НА ЭТОМ ХОРОШИЕ ДЕНЬГИ. МЫ РЕМОНТИРУЕМ ТУРБИНЫ КАК ЛЕГКОВЫХ АВТОМОБИЛЕЙ ТАК И ГРУЗОВЫХ, КОММЕРЧЕСКИХ АВТОМОБИЛЕЙ.\r\nСЛОМАЛАСЬ ТУРБИНА? ЭТО ЕЩЕ НЕ ПОВОД ПОКУПАТЬ \r\nНОВУЮ, ЕСТЬ ВОЗМОЖНОСТЬ ОТРЕМОНТИРОВАТЬ И ВОССТАНОВИТЬ ТЕКУЩУЮ ТУРБИНУ СЭКОНОМЯ НА ЭТОМ ХОРОШИЕ ДЕНЬГИ. МЫ РЕМОНТИРУЕМ ТУРБИНЫ КАК ЛЕГКОВЫХ АВТОМОБИЛЕЙ ТАК И ГРУЗОВЫХ, КОММЕРЧЕСКИХ АВТОМОБИЛЕЙ. &NBSP;ДАННЫЙ ВИД РЕМОНТА ЗАНИМАЕТ НЕ БОЛЕЕ 1 ДНЯ. &NBSP;РАБОТЫ ВКЛЮЧАЮТ В СЕБЯ ДИАГНОСТИКУ И РЕМОНТ АГРЕГАТА.&NBSP;', 1, NULL, NULL, NULL, NULL, NULL, 'N', '2753053', 'remont-turbin', '', '0', NULL, NULL, NULL),
(2753054, '2021-09-12 20:42:44', 1, '2021-08-26 10:32:03', 1, 30, NULL, 'Y', NULL, NULL, 400, 'Ремонт  рулевых реек', NULL, 'Если вас беспокоит стук в передней подвеске, течь из гидроусилителя и тугое вращения руля, то скорее всего у вас неисправна рулевая рейка. Мы осуществим ремонт и восстановление рулевой рейки &nbsp;и дадим гарантию.', 'html', NULL, 'Если вас беспокоит стук в передней подвеске, течь из гидроусилителя и тугое вращения руля, то скорее всего у вас неисправна рулевая рейка. Мы осуществим ремонт и восстановление рулевой рейки &nbsp;и дадим гарантию. Для ремонта рейки мы используем только качественные запасные части. Восстановленная рулевая рейка продлит удовольствие и безопасность вождения автомобиля на долгий срок.<br>', 'html', 'РЕМОНТ  РУЛЕВЫХ РЕЕК\r\nЕСЛИ ВАС БЕСПОКОИТ СТУК В ПЕРЕДНЕЙ ПОДВЕСКЕ, \r\nТЕЧЬ ИЗ ГИДРОУСИЛИТЕЛЯ И ТУГОЕ ВРАЩЕНИЯ РУЛЯ, ТО СКОРЕЕ ВСЕГО У ВАС НЕИСПРАВНА РУЛЕВАЯ РЕЙКА. МЫ ОСУЩЕСТВИМ РЕМОНТ И ВОССТАНОВЛЕНИЕ РУЛЕВОЙ РЕЙКИ &NBSP;И ДАДИМ ГАРАНТИЮ.\r\nЕСЛИ ВАС БЕСПОКОИТ СТУК В ПЕРЕДНЕЙ ПОДВЕСКЕ, \r\nТЕЧЬ ИЗ ГИДРОУСИЛИТЕЛЯ И ТУГОЕ ВРАЩЕНИЯ РУЛЯ, ТО СКОРЕЕ ВСЕГО У ВАС НЕИСПРАВНА РУЛЕВАЯ РЕЙКА. МЫ ОСУЩЕСТВИМ РЕМОНТ И ВОССТАНОВЛЕНИЕ РУЛЕВОЙ РЕЙКИ &NBSP;И ДАДИМ ГАРАНТИЮ. ДЛЯ РЕМОНТА РЕЙКИ МЫ ИСПОЛЬЗУЕМ ТОЛЬКО КАЧЕСТВЕННЫЕ ЗАПАСНЫЕ ЧАСТИ. ВОССТАНОВЛЕННАЯ РУЛЕВАЯ РЕЙКА ПРОДЛИТ УДОВОЛЬСТВИЕ И БЕЗОПАСНОСТЬ ВОЖДЕНИЯ АВТОМОБИЛЯ НА ДОЛГИЙ СРОК.', 1, NULL, NULL, NULL, NULL, NULL, 'N', '2753054', 'remont-rulevykh-reek', '', '0', NULL, NULL, NULL),
(2753055, '2021-09-12 20:37:58', 1, '2021-08-26 10:32:11', 1, 30, NULL, 'Y', NULL, NULL, 500, 'Ремонт форсунок', NULL, 'Окажем услуги по ремонту&nbsp;и восстановлению форсунок легковых и грузовых авто. Несправность форсунок может привести к капитальному ремонту дизельного двигателя.', 'html', NULL, 'Окажем услуги по ремонту&nbsp;и восстановлению форсунок легковых и грузовых авто. Несправность форсунок может привести к капитальному ремонту дизельного двигателя. Основные признаки проблем с форсунками: посторонние шумы в двигателе&nbsp;; задымленность,&nbsp;потеря мощности , повышенный расход топлива.', 'html', 'РЕМОНТ ФОРСУНОК\r\nОКАЖЕМ УСЛУГИ ПО РЕМОНТУ&NBSP;И ВОССТАНОВЛЕНИЮ \r\nФОРСУНОК ЛЕГКОВЫХ И ГРУЗОВЫХ АВТО. НЕСПРАВНОСТЬ ФОРСУНОК МОЖЕТ ПРИВЕСТИ К КАПИТАЛЬНОМУ РЕМОНТУ ДИЗЕЛЬНОГО ДВИГАТЕЛЯ.\r\nОКАЖЕМ УСЛУГИ ПО РЕМОНТУ&NBSP;И ВОССТАНОВЛЕНИЮ \r\nФОРСУНОК ЛЕГКОВЫХ И ГРУЗОВЫХ АВТО. НЕСПРАВНОСТЬ ФОРСУНОК МОЖЕТ ПРИВЕСТИ К КАПИТАЛЬНОМУ РЕМОНТУ ДИЗЕЛЬНОГО ДВИГАТЕЛЯ. ОСНОВНЫЕ ПРИЗНАКИ ПРОБЛЕМ С ФОРСУНКАМИ: ПОСТОРОННИЕ ШУМЫ В ДВИГАТЕЛЕ&NBSP;; ЗАДЫМЛЕННОСТЬ,&NBSP;ПОТЕРЯ МОЩНОСТИ , ПОВЫШЕННЫЙ РАСХОД ТОПЛИВА.', 1, NULL, NULL, NULL, NULL, NULL, 'N', '2753055', 'remont-forsunok', '', '0', NULL, NULL, NULL),
(2753056, '2021-09-12 20:35:54', 1, '2021-08-26 10:32:19', 1, 30, NULL, 'Y', NULL, NULL, 600, 'Ремонт  стартеров / генераторов', NULL, 'Произведем качественный ремонт стартеров и генераторов. Используем только новые запасные части.&nbsp;', 'html', NULL, 'Произведем качественный ремонт стартеров и генераторов. Используем только новые запасные части. &nbsp;На все работы даем гарантию<br>', 'html', 'РЕМОНТ  СТАРТЕРОВ / ГЕНЕРАТОРОВ\r\nПРОИЗВЕДЕМ КАЧЕСТВЕННЫЙ РЕМОНТ СТАРТЕРОВ \r\nИ ГЕНЕРАТОРОВ. ИСПОЛЬЗУЕМ ТОЛЬКО НОВЫЕ ЗАПАСНЫЕ ЧАСТИ.&NBSP;\r\nПРОИЗВЕДЕМ КАЧЕСТВЕННЫЙ РЕМОНТ СТАРТЕРОВ \r\nИ ГЕНЕРАТОРОВ. ИСПОЛЬЗУЕМ ТОЛЬКО НОВЫЕ ЗАПАСНЫЕ ЧАСТИ. &NBSP;НА ВСЕ РАБОТЫ ДАЕМ ГАРАНТИЮ', 1, NULL, NULL, NULL, NULL, NULL, 'N', '2753056', 'remont-starterov-generatorov', '', '0', NULL, NULL, NULL),
(2753057, '2021-09-12 20:33:10', 1, '2021-08-26 10:32:27', 1, 30, NULL, 'Y', NULL, NULL, 700, 'Ремонт LED фар', NULL, 'Произведем ремонт LED (светодиодных) фар. Зачастую это выходит в разы дешевле, чем замена всей фары. На все работы даем гарантию.', 'html', NULL, 'Начните оформлять разовую уборку: введите дату и время, параметры квартиры, привяжите карту, а в конце выберите подходящий вариант регулярности подписки на уборки. После этого в разделе «Мои заказы» вы увидите 4 ближайшие уборки со скидкой. Подписка продлевается автоматически, но каждая уборка оплачивается отдельно. Начните оформлять разовую уборку: введите дату и время, параметры квартиры, привяжите карту, а в конце выберите подходящий вариант регулярности подписки на уборки. После этого в разделе «Мои заказы» вы увидите 4 ближайшие уборки со скидкой. Подписка продлевается автоматически, но каждая уборка оплачивается отдельно. Начните оформлять разовую уборку: введите дату и время, параметры квартиры, привяжите карту, а в конце выберите подходящий вариант регулярности подписки на уборки. После этого в разделе «Мои заказы» вы увидите 4 ближайшие уборки со скидкой. Подписка продлевается автоматически, но каждая уборка оплачивается отдельно. ', 'text', 'РЕМОНТ LED ФАР\r\nПРОИЗВЕДЕМ РЕМОНТ LED (СВЕТОДИОДНЫХ) ФАР. \r\nЗАЧАСТУЮ ЭТО ВЫХОДИТ В РАЗЫ ДЕШЕВЛЕ, ЧЕМ ЗАМЕНА ВСЕЙ ФАРЫ. НА ВСЕ РАБОТЫ ДАЕМ ГАРАНТИЮ.\r\nНАЧНИТЕ ОФОРМЛЯТЬ РАЗОВУЮ УБОРКУ: ВВЕДИТЕ ДАТУ И ВРЕМЯ, ПАРАМЕТРЫ КВАРТИРЫ, ПРИВЯЖИТЕ КАРТУ, А В КОНЦЕ ВЫБЕРИТЕ ПОДХОДЯЩИЙ ВАРИАНТ РЕГУЛЯРНОСТИ ПОДПИСКИ НА УБОРКИ. ПОСЛЕ ЭТОГО В РАЗДЕЛЕ «МОИ ЗАКАЗЫ» ВЫ УВИДИТЕ 4 БЛИЖАЙШИЕ УБОРКИ СО СКИДКОЙ. ПОДПИСКА ПРОДЛЕВАЕТСЯ АВТОМАТИЧЕСКИ, НО КАЖДАЯ УБОРКА ОПЛАЧИВАЕТСЯ ОТДЕЛЬНО. НАЧНИТЕ ОФОРМЛЯТЬ РАЗОВУЮ УБОРКУ: ВВЕДИТЕ ДАТУ И ВРЕМЯ, ПАРАМЕТРЫ КВАРТИРЫ, ПРИВЯЖИТЕ КАРТУ, А В КОНЦЕ ВЫБЕРИТЕ ПОДХОДЯЩИЙ ВАРИАНТ РЕГУЛЯРНОСТИ ПОДПИСКИ НА УБОРКИ. ПОСЛЕ ЭТОГО В РАЗДЕЛЕ «МОИ ЗАКАЗЫ» ВЫ УВИДИТЕ 4 БЛИЖАЙШИЕ УБОРКИ СО СКИДКОЙ. ПОДПИСКА ПРОДЛЕВАЕТСЯ АВТОМАТИЧЕСКИ, НО КАЖДАЯ УБОРКА 