(2753099, '2021-09-12 17:21:16', 1, '2021-09-12 17:14:38', 1, 6, NULL, 'Y', NULL, NULL, 500, 'Главная', NULL, 'Наша компания занимается ремонтов всех типов автоматических АКПП а соленоиды,&nbsp;гидротрансформаторы, гидроблоки и&nbsp;блоки управления, мехатроник&nbsp;и другие &nbsp;части.<br>\r\n <br>\r\n Типы АКПП которые мы ремонтируем:<br>\r\n<ul>\r\n	<li>вариаторы,&nbsp;CVT</li>\r\n	<li>DSG ( S-tronic)</li>\r\n	<li>АКПП&nbsp;производства&nbsp;AISIN</li>\r\n	<li>АКПП&nbsp;производства&nbsp;ZF</li>\r\n	<li>Powershift</li>\r\n	<li>АКПП&nbsp;производства&nbsp;Jatco</li>\r\n</ul>\r\n Ремонт включает в себя диагностику, сам ремонт и проверку автоматической коробки.<br>\r\n <br>', 'html', NULL, '', 'text', 'ГЛАВНАЯ\r\nНАША КОМПАНИЯ ЗАНИМАЕТСЯ РЕМОНТОВ ВСЕХ \r\nТИПОВ АВТОМАТИЧЕСКИХ АКПП А СОЛЕНОИДЫ,&NBSP;ГИДРОТРАНСФОРМАТОРЫ, ГИДРОБЛОКИ И&NBSP;БЛОКИ УПРАВЛЕНИЯ, МЕХАТРОНИК&NBSP;И ДРУГИЕ &NBSP;ЧАСТИ.\r\n\r\nТИПЫ АКПП КОТОРЫЕ МЫ РЕМОНТИРУЕМ:\r\n\r\n\r\n- ВАРИАТОРЫ,&NBSP;CVT \r\n- DSG ( S-TRONIC) \r\n- АКПП&NBSP;ПРОИЗВОДСТВА&NBSP;AISIN \r\n- АКПП&NBSP;ПРОИЗВОДСТВА&NBSP;ZF \r\n- POWERSHIFT \r\n- АКПП&NBSP;ПРОИЗВОДСТВА&NBSP;JATCO РЕМОНТ ВКЛЮЧАЕТ \r\nВ СЕБЯ ДИАГНОСТИКУ, САМ РЕМОНТ И ПРОВЕРКУ АВТОМАТИЧЕСКОЙ КОРОБКИ.\r\n', 1, NULL, NULL, NULL, NULL, NULL, 'N', '2753099', '', '', '0', NULL, NULL, NULL),
