(2753113, '2021-09-12 19:42:38', 1, '2021-09-12 19:42:38', 1, 4, NULL, 'Y', NULL, NULL, 500, 'Можно ли ездить на неисправной АКПП?', NULL, 'Можно ли ездить на неисправной АКПП?', 'html', NULL, 'Можно, но это грозит более дорогим ремонтом впоследствии.', 'html', 'МОЖНО ЛИ ЕЗДИТЬ НА НЕИСПРАВНОЙ АКПП?\r\nМОЖНО ЛИ ЕЗДИТЬ НА НЕИСПРАВНОЙ АКПП?\r\nМОЖНО, НО ЭТО ГРОЗИТ БОЛЕЕ ДОРОГИМ РЕМОНТОМ \r\nВПОСЛЕДСТВИИ.', 1, NULL, NULL, NULL, NULL, NULL, 'N', '2753113', '', '', '0', NULL, NULL, NULL),
(2753114, '2021-09-12 20:49:13', 1, '2021-09-12 19:45:21', 1, 4, NULL, 'Y', NULL, NULL, 500, 'Сколько времени занимает ремонт ?', NULL, 'Сколько времени занимает ремонт?', 'html', NULL, 'При наличии запасных частей не более 1 дня.<br>', 'html', 'СКОЛЬКО ВРЕМЕНИ ЗАНИМАЕТ РЕМОНТ ?\r\nСКОЛЬКО ВРЕМЕНИ ЗАНИМАЕТ РЕМОНТ?\r\nПРИ НАЛИЧИИ ЗАПАСНЫХ ЧАСТЕЙ НЕ БОЛЕЕ 1 ДНЯ.', 1, NULL, NULL, NULL, NULL, NULL, 'N', '2753114', '', '', '0', NULL, NULL, NULL),
(2753115, '2021-09-12 20:48:30', 1, '2021-09-12 19:50:08', 1, 4, NULL, 'Y', NULL, NULL, 500, 'Что лучше робот или АКПП ?', NULL, 'Что лучше&nbsp;традиционная&nbsp;АКПП или&nbsp;робот?', 'html', NULL, 'Ремонт обычной гидротрансформаторной АКПП обойдется дешевле чем ремонт робота. В защиту современных роботов можем&nbsp;сказать что ресурс их уже сопоставим с ресурсом обычных АКПП.', 'html', 'ЧТО ЛУЧШЕ РОБОТ ИЛИ АКПП ?\r\nЧТО ЛУЧШЕ&NBSP;ТРАДИЦИОННАЯ&NBSP;АКПП ИЛИ&NBSP;РОБОТ?\r\nРЕМОНТ ОБЫЧНОЙ ГИДРОТРАНСФОРМАТОРНОЙ \r\nАКПП ОБОЙДЕТСЯ ДЕШЕВЛЕ ЧЕМ РЕМОНТ РОБОТА. В ЗАЩИТУ СОВРЕМЕННЫХ РОБОТОВ МОЖЕМ&NBSP;СКАЗАТЬ ЧТО РЕСУРС ИХ УЖЕ СОПОСТАВИМ С РЕСУРСОМ ОБЫЧНЫХ АКПП.', 1, NULL, NULL, NULL, NULL, NULL, 'N', '2753115', '', '', '0', NULL, NULL, NULL),
(2753116, '2021-09-12 20:02:13', 1, '2021-09-12 19:59:26', 1, 4, NULL, 'Y', NULL, NULL, 500, 'Какой срок службы восстановленного баллона', NULL, 'Какой срок службы восстановленного пневмобаллона?', 'html', NULL, 'Реальный срок службы наших восстановленных пневмобаллонов, как показывает практика, превышает срок службы оригинальных баллонов.', 'html', 'КАКОЙ СРОК СЛУЖБЫ ВОССТАНОВЛЕННОГО БАЛЛОНА\r\nКАКОЙ СРОК СЛУЖБЫ ВОССТАНОВЛЕННОГО ПНЕВМОБАЛЛОНА?\r\nРЕАЛЬНЫЙ СРОК СЛУЖБЫ НАШИХ ВОССТАНОВЛЕННЫХ \r\nПНЕВМОБАЛЛОНОВ, КАК ПОКАЗЫВАЕТ ПРАКТИКА, ПРЕВЫШАЕТ СРОК СЛУЖБЫ ОРИГИНАЛЬНЫХ БАЛЛОНОВ.', 1, NULL, NULL, NULL, NULL, NULL, 'N', '2753116', '', '', '0', NULL, NULL, NULL),
(2753117, '2021-09-12 20:08:35', 1, '2021-09-12 20:06:25', 1, 4, NULL, 'Y', NULL, NULL, 500, 'Какие основные проблемы могут быть с пневмоподвеской?', NULL, 'Какие основные проблемы пневмоподвески?', 'html', NULL, 'Утечка воздуха из пневмобаллонов, соединительных элементов и износ колец пневмокомпрессора. 70% всех поломок приходится на негерметичные пневмобаллоны.', 'html', 'КАКИЕ ОСНОВНЫЕ ПРОБЛЕМЫ МОГУТ БЫТЬ С ПНЕВМОПОДВЕСКОЙ?\r\nКАКИЕ ОСНОВНЫЕ ПРОБЛЕМЫ ПНЕВМОПОДВЕСКИ?\r\nУТЕЧКА ВОЗДУХА ИЗ ПНЕВМОБАЛЛОНОВ, СОЕДИНИТЕЛЬНЫХ \r\nЭЛЕМЕНТОВ И ИЗНОС КОЛЕЦ ПНЕВМОКОМПРЕССОРА. 70% ВСЕХ ПОЛОМОК ПРИХОДИТСЯ НА НЕГЕРМЕТИЧНЫЕ ПНЕВМОБАЛЛОНЫ.', 1, NULL, NULL, NULL, NULL, NULL, 'N', '2753117', '', '', '0', NULL, NULL, NULL),
(2753118, '2021-09-12 20:07:49', 1, '2021-09-12 20:07:49', 1, 4, NULL, 'Y', NULL, NULL, 500, 'Сколько времени занимает ремонт?', NULL, 'Сколько времени занимает ремонт пневмопвески?', 'html', NULL, 'Ремонт занимает не более 2-4 часов.', 'html', 'СКОЛЬКО ВРЕМЕНИ ЗАНИМАЕТ РЕМОНТ?\r\nСКОЛЬКО ВРЕМЕНИ ЗАНИМАЕТ РЕМОНТ ПНЕВМОПВЕСКИ?\r\nРЕМОНТ ЗАНИМАЕТ НЕ БОЛЕЕ 2-4 ЧАСОВ.', 1, NULL, NULL, NULL, NULL, NULL, 'N', '2753118', '', '', '0', NULL, NULL, NULL),
(2753119, '2021-09-12 20:13:18', 1, '2021-09-12 20:13:18', 1, 4, NULL, 'Y', NULL, NULL, 500, 'Какие основные проблемы могут быть с форсунками?', NULL, 'Основные признаки неисправных форсунок', 'html', NULL, 'Невозможность запуска двигателя,&nbsp;потеря мощности, детонация. &nbsp;увеличенный расход топлива. Затягивание ремонта чревато дальнейшим капитальным ремонтов двигателя.<br>', 'html', 'КАКИЕ ОСНОВНЫЕ ПРОБЛЕМЫ МОГУТ БЫТЬ С ФОРСУНКАМИ?\r\nОСНОВНЫЕ ПРИЗНАКИ НЕИСПРАВНЫХ ФОРСУНОК\r\nНЕВОЗМОЖНОСТЬ ЗАПУСКА ДВИГАТЕЛЯ,&NBSP;ПОТЕРЯ \r\nМОЩНОСТИ, ДЕТОНАЦИЯ. &NBSP;УВЕЛИЧЕННЫЙ РАСХОД ТОПЛИВА. ЗАТЯГИВАНИЕ РЕМОНТА ЧРЕВАТО ДАЛЬНЕЙШИМ КАПИТАЛЬНЫМ РЕМОНТОВ ДВИГАТЕЛЯ.', 1, NULL, NULL, NULL, NULL, NULL, 'N', '2753119', '', '', '0', NULL, NULL, NULL),
(2753120, '2021-09-12 20:15:08', 1, '2021-09-12 20:15:08', 1, 4, NULL, 'Y', NULL, NULL, 500, 'Сколько по времени занимает ремонт форсунок?', NULL, 'Сколько по времени занимает ремонт форсунок?', 'html', NULL, 'Обычно это восстановление занимает несколько часов.<br>', 'html', 'СКОЛЬКО ПО ВРЕМЕНИ ЗАНИМАЕТ РЕМОНТ ФОРСУНОК?\r\nСКОЛЬКО ПО ВРЕМЕНИ ЗАНИМАЕТ РЕМОНТ ФОРСУНОК?\r\nОБЫЧНО ЭТО ВОССТАНОВЛЕНИЕ ЗАНИМАЕТ НЕСКОЛЬКО \r\nЧАСОВ.', 1, NULL, NULL, NULL, NULL, NULL, 'N', '2753120', '', '', '0', NULL, NULL, NULL);
