(15420687, 82, 2753057, 'a:2:{s:4:\"TEXT\";s:475:\"Осуществляем ремонт светодиодных (led) фар. Опыт работы более 4 лет. Ремонт позволит вам сэкономить до 90% от стоимости новой фары. У нас много авторизованных сервисных центров по всей России - в частности !CITY!, Москве, Санкт Петербурге и т.д. (Заполнено в элементе)<br>\";s:4:\"TYPE\";s:4:\"TEXT\";}', 'text', NULL, 0.0000, ''),
