(15420689, 82, 2753056, 'a:2:{s:4:\"TEXT\";s:486:\"Ремонт стартеров и генераторов является одной из частых услуг в нашем компании. Цены на данный вид услуг у у нас одни самых низких. У нас много авторизированных сервисных центров по всей России - в частности !CITY!, Москве, Санкт Петербурге и т.д. (Заполнено в элементе)<br>\";s:4:\"TYPE\";s:4:\"TEXT\";}', 'text', NULL, 0.0000, ''),
