(15420691, 82, 2753055, 'a:2:{s:4:\"TEXT\";s:420:\"Оказываем ремонт дизельных форсунок. На восстановленную форсунку даем собственную гарантию.  У нас много авторизированных сервисных центров по всей России - в частности !CITY!, Москве, Санкт Петербурге и т.д. (Заполнено в элементе)<br>\";s:4:\"TYPE\";s:4:\"TEXT\";}', 'text', NULL, 0.0000, ''),
(15420692, 76, 2753054, '6', 'text', 6, NULL, NULL),
(15420693, 82, 2753054, 'a:2:{s:4:\"TEXT\";s:573:\"Одним из направлений нашей компании является ремонт рулевых реек, ГУР и ЭУР.Восстановленые рейки не уступают по ресурсу новым. Применяем зап. части оригинальных производителей. У нас много авторизированных сервисных центров по всей России - в частности !CITY!, Москве, Санкт Петербурге и т.д. (Заполнено в элементе)<br>\";s:4:\"TYPE\";s:4:\"TEXT\";}', 'text', NULL, 0.0000, ''),
(15420694, 76, 2753053, '6', 'text', 6, NULL, NULL),
(15420695, 82, 2753053, 'a:2:{s:4:\"TEXT\";s:713:\"Наш более чем 4 летний опыт позволяет нам качественно оказывать услугу по ремонту турбин.  Многим известно что новая турбина стоит очень дорого в сравнении с ремонтом текущей. Поэтому данная услуга пользуется большой популярностью среди наших клиентов.. У нас много авторизированных сервисных центров по всей России - в частности !CITY!, Москве, Санкт Петербурге и т.д. (Заполнено в элементе)<br>\";s:4:\"TYPE\";s:4:\"HTML\";}', 'text', NULL, 0.0000, '');
