(82, '2021-08-26 14:07:03', 30, 'Текст seo блока', 'Y', 1100, 'SEO_TEXT', 'a:2:{s:4:\"TYPE\";s:4:\"HTML\";s:4:\"TEXT\";s:596:\"Наш сервисный центр осуществляет ремонт автоматических коробок передач любой сложности на машинах !AUTO_FULL!. У нас есть опыт работы со всеми типами АКПП – автоматическими, роботизированными (DSG, VVT), вариаторными и т.д. У нас много авторизированных сервисных центров по всей России - в частности !CITY!, Москве, Санкт Петербурге и т.д.\";}', 'S', 1, 30, 'L', 'N', NULL, '', 5, NULL, 0, 'N', 'N', 'N', 'N', 1, 'HTML', 'a:1:{s:6:\"height\";i:200;}', ''),
(83, '2021-08-26 13:38:34', 30, 'Title', 'Y', 200, 'TITLE', 'a:2:{s:4:\"TYPE\";s:4:\"HTML\";s:4:\"TEXT\";s:144:\"Качественный  !SERVICE! !AUTO_FULL! с гарантией !CITY! по цене от 1000 | Умный автосервис EASYRIDE \";}', 'S', 1, 30, 'L', 'N', NULL, '', 5, NULL, 0, 'N', 'N', 'N', 'N', 1, 'HTML', 'a:1:{s:6:\"height\";i:200;}', ''),
(84, '2021-08-26 13:52:25', 30, 'Description', 'Y', 300, 'DESCRIPTION', 'a:2:{s:4:\"TYPE\";s:4:\"HTML\";s:4:\"TEXT\";s:324:\"Умный автосервис EASYRIDE осуществляет качественный и недорогой !SERVICE! !AUTO_FULL! с гарантией !CITY! по цене от 1000 на самом современном оборудовании по заводским стандартам производителя.\";}', 'S', 1, 30, 'L', 'N', NULL, '', 5, NULL, 0, 'N', 'N', 'N', 'N', 1, 'HTML', 'a:1:{s:6:\"height\";i:200;}', ''),
