INSERT INTO `b_search_content` VALUES
(1, '2021-09-12 19:02:23', 'iblock', '1', 0, NULL, NULL, NULL, '=ID=1&EXTERNAL_ID=1&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=content&IBLOCK_ID=1&IBLOCK_CODE=&IBLOCK_EXTERNAL_ID=&CODE=', 'Сервис Easyride', '', '', 'content', '1', NULL, NULL, NULL),
(2, '2021-08-20 16:33:01', 'iblock', '2', 0, NULL, NULL, NULL, '=ID=2&EXTERNAL_ID=2&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=content&IBLOCK_ID=1&IBLOCK_CODE=&IBLOCK_EXTERNAL_ID=&CODE=', 'Обычный сервис', '', '', 'content', '1', NULL, NULL, NULL),
(3, '2021-09-12 16:46:55', 'iblock', '3', 0, NULL, NULL, NULL, '=ID=3&EXTERNAL_ID=3&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=content&IBLOCK_ID=2&IBLOCK_CODE=&IBLOCK_EXTERNAL_ID=&CODE=', 'Работаем во всех регионах России', 'Наша сеть партнеров позволяет нам работать на все территории РФ.  Теперь клиент  в каждом регионе страны может воспользоваться нашими услугами по ремонту агрегатов. Настроенная система логистика позволяет выполнять ремонт в очень сжатые сроки.', '', 'content', '2', NULL, NULL, NULL),
(4, '2021-09-12 16:44:58', 'iblock', '4', 0, NULL, NULL, NULL, '=ID=4&EXTERNAL_ID=4&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=content&IBLOCK_ID=2&IBLOCK_CODE=&IBLOCK_EXTERNAL_ID=&CODE=', 'Сертифицированные специалисты', 'Наша компания уделяет большое внимание обучению сотрудников. У нас выработана своя учебная система и внутрення сертификация сотрудников.', '', 'content', '2', NULL, NULL, NULL),
(5, '2021-09-12 16:43:09', 'iblock', '5', 0, NULL, NULL, NULL, '=ID=5&EXTERNAL_ID=5&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=content&IBLOCK_ID=2&IBLOCK_CODE=&IBLOCK_EXTERNAL_ID=&CODE=', 'Самое современное оборудование в РФ', 'Наше оборудование является нашей гордостью. Часть мы закупаем его у поставщиков зарубежом, часть производим сами. Большая часть оборудования работает на проверку готовой продукции, что позволяет нам давать гарантию на более длительный срок.', '', 'content', '2', NULL, NULL, NULL),
(6, '2021-09-12 16:39:52', 'iblock', '6', 0, NULL, NULL, NULL, '=ID=6&EXTERNAL_ID=6&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=content&IBLOCK_ID=2&IBLOCK_CODE=&IBLOCK_EXTERNAL_ID=&CODE=', 'Ремонт по заводским стандартам', 'Наши стандарты ремонта агрегатов максимально схожи с заводскими требованиями к новым изделиям. Это выгодно отличает нас от конкурентов.  Мы считаем что только высокие стандарты помогут нам предоставить такое качество сервиса, которое устроит требовательных клиентов.', '', 'content', '2', NULL, NULL, NULL),
(7, '2021-08-23 09:44:20', 'iblock', '7', 0, NULL, NULL, NULL, '=ID=7&EXTERNAL_ID=7&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=content&IBLOCK_ID=2&IBLOCK_CODE=&IBLOCK_EXTERNAL_ID=&CODE=', 'Гарантия 1-5 лет', 'Гарантия \r1-5 лет\rпри условии пробега \rдо 20 000 км', '', 'content', '2', NULL, NULL, NULL),
(8, '2021-09-12 19:20:40', 'iblock', '8', 0, NULL, NULL, NULL, '=ID=8&EXTERNAL_ID=8&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=content&IBLOCK_ID=3&IBLOCK_CODE=&IBLOCK_EXTERNAL_ID=&CODE=', 'Ремонт пневмобаллонов', 'от 8 900 р.', '', 'content', '3', NULL, NULL, NULL),
(9, '2021-09-12 19:10:53', 'iblock', '9', 0, NULL, NULL, NULL, '=ID=9&EXTERNAL_ID=9&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=content&IBLOCK_ID=3&IBLOCK_CODE=&IBLOCK_EXTERNAL_ID=&CODE=', 'Диагностика', 'Бесплатно', '', 'content', '3', NULL, NULL, NULL),
(10, '2021-09-12 19:12:36', 'iblock', '10', 0, NULL, NULL, NULL, '=ID=10&EXTERNAL_ID=10&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=content&IBLOCK_ID=3&IBLOCK_CODE=&IBLOCK_EXTERNAL_ID=&CODE=', 'Ремонт вариаторов', 'от 9 900 р.', '', 'content', '3', NULL, NULL, NULL),
(15, '2021-09-12 20:47:36', 'iblock', '15', 0, NULL, NULL, NULL, '=ID=15&EXTERNAL_ID=15&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=content&IBLOCK_ID=4&IBLOCK_CODE=&IBLOCK_EXTERNAL_ID=&CODE=', 'Какие основные симптомы неисправной АКПП?', 'Какие основные симптомы неисправной коробки?\r\nСимптомов множество: вибрации во время движения; стуки в районе расположения АКПП, пропуск или отсутствие отдельных передач, полное обездвиживание автомобиля, загорание контрольной лампы на приборной панели.', '', 'content', '4', NULL, NULL, NULL),
(42, '2021-08-23 11:39:00', 'iblock', '41', 0, NULL, NULL, NULL, '=ID=41&EXTERNAL_ID=41&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=content&IBLOCK_ID=7&IBLOCK_CODE=&IBLOCK_EXTERNAL_ID=&CODE=', 'Ведомости', '', '', 'content', '7', NULL, NULL, NULL),
(43, '2021-08-23 11:39:20', 'iblock', '42', 0, NULL, NULL, NULL, '=ID=42&EXTERNAL_ID=42&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=content&IBLOCK_ID=7&IBLOCK_CODE=&IBLOCK_EXTERNAL_ID=&CODE=', 'Коммерсантъ', '', '', 'content', '7', NULL, NULL, NULL),
(44, '2021-08-23 11:39:40', 'iblock', '43', 0, NULL, NULL, NULL, '=ID=43&EXTERNAL_ID=43&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=content&IBLOCK_ID=7&IBLOCK_CODE=&IBLOCK_EXTERNAL_ID=&CODE=', 'Lenta.ru', '', '', 'content', '7', NULL, NULL, NULL),
(45, '2021-08-23 11:39:52', 'iblock', '44', 0, NULL, NULL, NULL, '=ID=44&EXTERNAL_ID=44&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=content&IBLOCK_ID=7&IBLOCK_CODE=&IBLOCK_EXTERNAL_ID=&CODE=', 'vc.ru', '', '', 'content', '7', NULL, NULL, NULL),
(46, '2021-08-23 11:58:13', 'iblock', '45', 0, NULL, NULL, NULL, '=ID=45&EXTERNAL_ID=45&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=content&IBLOCK_ID=8&IBLOCK_CODE=&IBLOCK_EXTERNAL_ID=&CODE=', 'Расчет ремонта', 'Рассчитайте\rпредварительную стоимость на сайте', '', 'content', '8', NULL, NULL, NULL),
(47, '2021-09-11 18:46:09', 'iblock', '46', 0, NULL, NULL, NULL, '=ID=46&EXTERNAL_ID=46&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=content&IBLOCK_ID=8&IBLOCK_CODE=&IBLOCK_EXTERNAL_ID=&CODE=', 'Проведение ремонта', 'Приезд в один из \r356 ближайших\rк вам наших сервис партнеров либо самостоятельная отправка к нам неисправного агрегата', '', 'content', '8', NULL, NULL, NULL),
(48, '2021-08-23 12:37:06', 'main', 's1|/about/index.php', 0, NULL, NULL, NULL, '/about/index.php', 'О компании', 'Адреса наших партнеров\rВыберите ваш город чтобы увидеть адреса сервисных центров\rВыберите округ\rВыберите регион\rВыберите город\rг. Краснодар, ул. 1-го мая, д. 234, сервис “Eazyride”\rг. Краснодар, ул. 1-го мая, д. 234, сервис “Eazyride”\rг. Краснодар, ул. 1-го мая, д. 234, сервис “Eazyride”\rг. Краснодар, ул. 1-го мая, д. 234, сервис “Eazyride”', '', '', '', NULL, NULL, NULL),
(49, '2021-09-12 18:56:43', 'iblock', '47', 0, NULL, NULL, NULL, '=ID=47&EXTERNAL_ID=47&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=content&IBLOCK_ID=9&IBLOCK_CODE=&IBLOCK_EXTERNAL_ID=&CODE=', 'О компании', 'Цель, “EazyRide”\r- избавить клиентов от всех забот, связанных со сложным ремонтом автомобильных агрегатов\r\n\rКомпания основана в 2020 году. Основной целью компании является оказание услуг по ремонту автомобильных агрегатов для существующих автосервисных центров.\rВ компании более 100 человек: инженеры по ремонту, менеджеры по продажам и ведению клиентов, программисты и маркетологи. Eazyride сейчас активно подготавливаем учебную базу для обучения не только своих, но и сторонних сотрудников.', '', 'content', '9', NULL, NULL, NULL),
(50, '2021-08-23 14:40:57', 'main', 's1|/to_services/index.php', 0, NULL, NULL, NULL, '/to_services/index.php', 'Автосервисам', '', '', '', '', NULL, NULL, NULL),
(51, '2021-08-24 09:25:38', 'iblock', '48', 0, NULL, NULL, NULL, '=ID=48&EXTERNAL_ID=48&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=content&IBLOCK_ID=9&IBLOCK_CODE=&IBLOCK_EXTERNAL_ID=&CODE=', 'Автосервисам', 'Получите\rбесплатно \rот нас клиентов\r\n\rПредложение которое не требует от вас вложений\rПредложите наши услуги вашим клиентам и \rполучайте доход\rРаботаем по всей России', '', 'content', '9', NULL, NULL, NULL),
