(2753036, '2021-09-12 18:58:29', 'iblock', '2753045', 0, NULL, NULL, NULL, '=ID=2753045&EXTERNAL_ID=2753045&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=content&IBLOCK_ID=9&IBLOCK_CODE=&IBLOCK_EXTERNAL_ID=&CODE=', 'Контакты', 'Цель, “EazyRide”\r- избавить клиентов от всех забот, связанных со сложным ремонтом автомобильных агрегатов\r\n\rКомпания основана в 2020 году. Основной целью компании является оказание услуг по ремонту автомобильных агрегатов для существующих автосервисных центров.\rВ компании более 100 человек: инженеры по ремонту, менеджеры по продажам и ведению клиентов, программисты и маркетологи. Eazyride сейчас активно подготавливаем учебную базу для обучения не только своих, но и сторонних сотрудников.', '', 'content', '9', NULL, NULL, NULL),
