(2753038, '2021-09-12 20:27:49', 'iblock', '2753051', 0, NULL, NULL, NULL, '=ID=2753051&EXTERNAL_ID=2753051&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=content&IBLOCK_ID=30&IBLOCK_CODE=&IBLOCK_EXTERNAL_ID=&CODE=remont-akpp', 'Ремонт АКПП', 'Начните оформлять разовую уборку: введите дату и время, параметры квартиры, привяжите карту, а в конце выберите подходящий вариант регулярности подписки на уборки. После этого в разделе «Мои заказы» вы увидите 4 ближайшие уборки со скидкой. Подписка продлевается автоматически, но каждая уборка оплачивается отдельно.\r\nНачните оформлять разовую уборку: введите дату и время, параметры квартиры, привяжите карту, а в конце выберите подходящий вариант регулярности подписки на уборки. После этого в разделе «Мои заказы» вы увидите 4 ближайшие уборки со скидкой. Подписка продлевается автоматически, но каждая уборка оплачивается отдельно. Начните оформлять разовую уборку: введите дату и время, параметры квартиры, привяжите карту, а в конце выберите подходящий вариант регулярности подписки на уборки. После этого в разделе «Мои заказы» вы увидите 4 ближайшие уборки со скидкой. Подписка продлевается автоматически, но каждая уборка оплачивается отдельно. Начните оформлять разовую уборку: введите дату и время, параметры квартиры, привяжите карту, а в конце выберите подходящий вариант регулярности подписки на уборки. После этого в разделе «Мои заказы» вы увидите 4 ближайшие уборки со скидкой. Подписка продлевается автоматически, но каждая уборка оплачивается отдельно.', '', 'content', '30', NULL, NULL, NULL),
(2753039, '2021-09-12 20:30:18', 'iblock', '2753052', 0, NULL, NULL, NULL, '=ID=2753052&EXTERNAL_ID=2753052&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=content&IBLOCK_ID=30&IBLOCK_CODE=&IBLOCK_EXTERNAL_ID=&CODE=remont-pnevmopodveski', 'Ремонт пневмоподвески', 'Быстро и качественно отремонтируем пневмоподвеску и ее элементы: пневмобаллоны, пневмостойки, пневмокомпрессоры и газо-масляные амортизаторы.\r\nБыстро и качественно отремонтируем пневмоподвеску и ее элементы: пневмобаллоны, пневмостойки, пневмокомпрессоры и газо-масляные амортизаторы. У нас имеется свое производство пневмобаллонов и стоек.  На все работы даем собственную гарантию.', '', 'content', '30', NULL, NULL, NULL),
(2753040, '2021-09-12 20:45:56', 'iblock', '2753053', 0, NULL, NULL, NULL, '=ID=2753053&EXTERNAL_ID=2753053&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=content&IBLOCK_ID=30&IBLOCK_CODE=&IBLOCK_EXTERNAL_ID=&CODE=remont-turbin', 'Ремонт турбин', 'Сломалась турбина? Это еще не повод покупать новую, есть возможность отремонтировать и восстановить текущую турбину сэкономя на этом хорошие деньги. Мы ремонтируем турбины как легковых автомобилей так и грузовых, коммерческих автомобилей.\r\r\nСломалась турбина? Это еще не повод покупать новую, есть возможность отремонтировать и восстановить текущую турбину сэкономя на этом хорошие деньги. Мы ремонтируем турбины как легковых автомобилей так и грузовых, коммерческих автомобилей. Данный вид ремонта занимает не более 1 дня. Работы включают в себя диагностику и ремонт агрегата.', '', 'content', '30', NULL, NULL, NULL),
(2753041, '2021-09-12 20:42:44', 'iblock', '2753054', 0, NULL, NULL, NULL, '=ID=2753054&EXTERNAL_ID=2753054&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=content&IBLOCK_ID=30&IBLOCK_CODE=&IBLOCK_EXTERNAL_ID=&CODE=remont-rulevykh-reek', 'Ремонт  рулевых реек', 'Если вас беспокоит стук в передней подвеске, течь из гидроусилителя и тугое вращения руля, то скорее всего у вас неисправна рулевая рейка. Мы осуществим ремонт и восстановление рулевой рейки и дадим гарантию.\r\nЕсли вас беспокоит стук в передней подвеске, течь из гидроусилителя и тугое вращения руля, то скорее всего у вас неисправна рулевая рейка. Мы осуществим ремонт и восстановление рулевой рейки и дадим гарантию. Для ремонта рейки мы используем только качественные запасные части. Восстановленная рулевая рейка продлит удовольствие и безопасность вождения автомобиля на долгий срок.', '', 'content', '30', NULL, NULL, NULL),
(2753042, '2021-09-12 20:37:58', 'iblock', '2753055', 0, NULL, NULL, NULL, '=ID=2753055&EXTERNAL_ID=2753055&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=content&IBLOCK_ID=30&IBLOCK_CODE=&IBLOCK_EXTERNAL_ID=&CODE=remont-forsunok', 'Ремонт форсунок', 'Окажем услуги по ремонту и восстановлению форсунок легковых и грузовых авто. Несправность форсунок может привести к капитальному ремонту дизельного двигателя.\r\nОкажем услуги по ремонту и восстановлению форсунок легковых и грузовых авто. Несправность форсунок может привести к капитальному ремонту дизельного двигателя. Основные признаки проблем с форсунками: посторонние шумы в двигателе ; задымленность, потеря мощности , повышенный расход топлива.', '', 'content', '30', NULL, NULL, NULL),
(2753043, '2021-09-12 20:35:54', 'iblock', '2753056', 0, NULL, NULL, NULL, '=ID=2753056&EXTERNAL_ID=2753056&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=content&IBLOCK_ID=30&IBLOCK_CODE=&IBLOCK_EXTERNAL_ID=&CODE=remont-starterov-generatorov', 'Ремонт  стартеров / генераторов', 'Произведем качественный ремонт стартеров и генераторов. Используем только новые запасные части. \r\nПроизведем качественный ремонт стартеров и генераторов. Используем только новые запасные части. На все работы даем гарантию', '', 'content', '30', NULL, NULL, NULL),
(2753044, '2021-09-12 20:33:10', 'iblock', '2753057', 0, NULL, NULL, NULL, '=ID=2753057&EXTERNAL_ID=2753057&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=content&IBLOCK_ID=30&IBLOCK_CODE=&IBLOCK_EXTERNAL_ID=&CODE=remont-led-far', 'Ремонт LED фар', 'Произведем ремонт LED (светодиодных) фар. Зачастую это выходит в разы дешевле, чем замена всей фары. На все работы даем гарантию.\r\nНачните оформлять разовую уборку: введите дату и время, параметры квартиры, привяжите карту, а в конце выберите подходящий вариант регулярности подписки на уборки. После этого в разделе «Мои заказы» вы увидите 4 ближайшие уборки со скидкой. Подписка продлевается автоматически, но каждая уборка оплачивается отдельно. Начните оформлять разовую уборку: введите дату и время, параметры квартиры, привяжите карту, а в конце выберите подходящий вариант регулярности подписки на уборки. После этого в разделе «Мои заказы» вы увидите 4 ближайшие уборки со скидкой. Подписка продлевается автоматически, но каждая уборка оплачивается отдельно. Начните оформлять разовую уборку: введите дату и время, параметры квартиры, привяжите карту, а в конце выберите подходящий вариант регулярности подписки на уборки. После этого в разделе «Мои заказы» вы увидите 4 ближайшие уборки со скидкой. Подписка продлевается автоматически, но каждая уборка оплачивается отдельно.', '', 'content', '30', NULL, NULL, NULL),
(2753045, '2021-09-12 17:21:16', 'iblock', '2753099', 0, NULL, NULL, NULL, '=ID=2753099&EXTERNAL_ID=2753099&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=content&IBLOCK_ID=6&IBLOCK_CODE=&IBLOCK_EXTERNAL_ID=&CODE=', 'Главная', 'Наша компания занимается ремонтов всех типов автоматических АКПП а соленоиды, гидротрансформаторы, гидроблоки и блоки управления, мехатроник и другие части.\rТипы АКПП которые мы ремонтируем:\rвариаторы, CVT\rDSG ( S-tronic)\rАКПП производства AISIN\rАКПП производства ZF\rPowershift\rАКПП производства Jatco\rРемонт включает в себя диагностику, сам ремонт и проверку автоматической коробки.', '', 'content', '6', NULL, NULL, NULL),
