(2753059, '2021-09-12 19:42:38', 'iblock', '2753113', 0, NULL, NULL, NULL, '=ID=2753113&EXTERNAL_ID=2753113&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=content&IBLOCK_ID=4&IBLOCK_CODE=&IBLOCK_EXTERNAL_ID=&CODE=', 'Можно ли ездить на неисправной АКПП?', 'Можно ли ездить на неисправной АКПП?\r\nМожно, но это грозит более дорогим ремонтом впоследствии.', '', 'content', '4', NULL, NULL, NULL),
(2753060, '2021-09-12 20:49:13', 'iblock', '2753114', 0, NULL, NULL, NULL, '=ID=2753114&EXTERNAL_ID=2753114&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=content&IBLOCK_ID=4&IBLOCK_CODE=&IBLOCK_EXTERNAL_ID=&CODE=', 'Сколько времени занимает ремонт ?', 'Сколько времени занимает ремонт?\r\nПри наличии запасных частей не более 1 дня.', '', 'content', '4', NULL, NULL, NULL),
(2753061, '2021-09-12 20:48:30', 'iblock', '2753115', 0, NULL, NULL, NULL, '=ID=2753115&EXTERNAL_ID=2753115&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=content&IBLOCK_ID=4&IBLOCK_CODE=&IBLOCK_EXTERNAL_ID=&CODE=', 'Что лучше робот или АКПП ?', 'Что лучше традиционная АКПП или робот?\r\nРемонт обычной гидротрансформаторной АКПП обойдется дешевле чем ремонт робота. В защиту современных роботов можем сказать что ресурс их уже сопоставим с ресурсом обычных АКПП.', '', 'content', '4', NULL, NULL, NULL),
(2753062, '2021-09-12 20:02:13', 'iblock', '2753116', 0, NULL, NULL, NULL, '=ID=2753116&EXTERNAL_ID=2753116&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=content&IBLOCK_ID=4&IBLOCK_CODE=&IBLOCK_EXTERNAL_ID=&CODE=', 'Какой срок службы восстановленного баллона', 'Какой срок службы восстановленного пневмобаллона?\r\nРеальный срок службы наших восстановленных пневмобаллонов, как показывает практика, превышает срок службы оригинальных баллонов.', '', 'content', '4', NULL, NULL, NULL),
(2753063, '2021-09-12 20:08:35', 'iblock', '2753117', 0, NULL, NULL, NULL, '=ID=2753117&EXTERNAL_ID=2753117&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=content&IBLOCK_ID=4&IBLOCK_CODE=&IBLOCK_EXTERNAL_ID=&CODE=', 'Какие основные проблемы могут быть с пневмоподвеской?', 'Какие основные проблемы пневмоподвески?\r\nУтечка воздуха из пневмобаллонов, соединительных элементов и износ колец пневмокомпрессора. 70% всех поломок приходится на негерметичные пневмобаллоны.', '', 'content', '4', NULL, NULL, NULL),
(2753064, '2021-09-12 20:07:49', 'iblock', '2753118', 0, NULL, NULL, NULL, '=ID=2753118&EXTERNAL_ID=2753118&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=content&IBLOCK_ID=4&IBLOCK_CODE=&IBLOCK_EXTERNAL_ID=&CODE=', 'Сколько времени занимает ремонт?', 'Сколько времени занимает ремонт пневмопвески?\r\nРемонт занимает не более 2-4 часов.', '', 'content', '4', NULL, NULL, NULL),
(2753065, '2021-09-12 20:13:18', 'iblock', '2753119', 0, NULL, NULL, NULL, '=ID=2753119&EXTERNAL_ID=2753119&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=content&IBLOCK_ID=4&IBLOCK_CODE=&IBLOCK_EXTERNAL_ID=&CODE=', 'Какие основные проблемы могут быть с форсунками?', 'Основные признаки неисправных форсунок\r\nНевозможность запуска двигателя, потеря мощности, детонация. увеличенный расход топлива. Затягивание ремонта чревато дальнейшим капитальным ремонтов двигателя.', '', 'content', '4', NULL, NULL, NULL),
(2753066, '2021-09-12 20:15:08', 'iblock', '2753120', 0, NULL, NULL, NULL, '=ID=2753120&EXTERNAL_ID=2753120&IBLOCK_SECTION_ID=&IBLOCK_TYPE_ID=content&IBLOCK_ID=4&IBLOCK_CODE=&IBLOCK_EXTERNAL_ID=&CODE=', 'Сколько по времени занимает ремонт форсунок?', 'Сколько по времени занимает ремонт форсунок?\r\nОбычно это восстановление занимает несколько часов.', '', 'content', '4', NULL, NULL, NULL);
