INSERT INTO `b_search_content_text` VALUES
(1, '9a4dc5287e74b51bd372b10a242dc835', 'СЕРВИС EASYRIDE\r\n\r\n'),
(2, '94458781a3370dd0ba7e09e05a8577e0', 'ОБЫЧНЫЙ СЕРВИС\r\n\r\n'),
(3, 'f44a1dfcec7512f477e4f23e3783617a', 'РАБОТАЕМ ВО ВСЕХ РЕГИОНАХ РОССИИ\r\nНАША СЕТЬ ПАРТНЕРОВ ПОЗВОЛЯЕТ НАМ РАБОТАТЬ НА ВСЕ ТЕРРИТОРИИ РФ.  ТЕПЕРЬ КЛИЕНТ  В КАЖДОМ РЕГИОНЕ СТРАНЫ МОЖЕТ ВОСПОЛЬЗОВАТЬСЯ НАШИМИ УСЛУГАМИ ПО РЕМОНТУ АГРЕГАТОВ. НАСТРОЕННАЯ СИСТЕМА ЛОГИСТИКА ПОЗВОЛЯЕТ ВЫПОЛНЯТЬ РЕМОНТ В ОЧЕНЬ СЖАТЫЕ СРОКИ.\r\n'),
(4, '63ccd54a8464fb7093bb4af863851d6d', 'СЕРТИФИЦИРОВАННЫЕ СПЕЦИАЛИСТЫ\r\nНАША КОМПАНИЯ УДЕЛЯЕТ БОЛЬШОЕ ВНИМАНИЕ ОБУЧЕНИЮ СОТРУДНИКОВ. У НАС ВЫРАБОТАНА СВОЯ УЧЕБНАЯ СИСТЕМА И ВНУТРЕННЯ СЕРТИФИКАЦИЯ СОТРУДНИКОВ.\r\n'),
(5, '4b97921048fd92d5375a90b77a65dd9c', 'САМОЕ СОВРЕМЕННОЕ ОБОРУДОВАНИЕ В РФ\r\nНАШЕ ОБОРУДОВАНИЕ ЯВЛЯЕТСЯ НАШЕЙ ГОРДОСТЬЮ. ЧАСТЬ МЫ ЗАКУПАЕМ ЕГО У ПОСТАВЩИКОВ ЗАРУБЕЖОМ, ЧАСТЬ ПРОИЗВОДИМ САМИ. БОЛЬШАЯ ЧАСТЬ ОБОРУДОВАНИЯ РАБОТАЕТ НА ПРОВЕРКУ ГОТОВОЙ ПРОДУКЦИИ, ЧТО ПОЗВОЛЯЕТ НАМ ДАВАТЬ ГАРАНТИЮ НА БОЛЕЕ ДЛИТЕЛЬНЫЙ СРОК.\r\n'),
(6, '76dc0dad15afba051cce8011367f1e5c', 'РЕМОНТ ПО ЗАВОДСКИМ СТАНДАРТАМ\r\nНАШИ СТАНДАРТЫ РЕМОНТА АГРЕГАТОВ МАКСИМАЛЬНО СХОЖИ С ЗАВОДСКИМИ ТРЕБОВАНИЯМИ К НОВЫМ ИЗДЕЛИЯМ. ЭТО ВЫГОДНО ОТЛИЧАЕТ НАС ОТ КОНКУРЕНТОВ.  МЫ СЧИТАЕМ ЧТО ТОЛЬКО ВЫСОКИЕ СТАНДАРТЫ ПОМОГУТ НАМ ПРЕДОСТАВИТЬ ТАКОЕ КАЧЕСТВО СЕРВИСА, КОТОРОЕ УСТРОИТ ТРЕБОВАТЕЛЬНЫХ КЛИЕНТОВ.\r\n'),
(7, '7ef4fcdb3c820689608e1e995b8e18f1', 'ГАРАНТИЯ 1-5 ЛЕТ\r\nГАРАНТИЯ \r1-5 ЛЕТ\rПРИ УСЛОВИИ ПРОБЕГА \rДО 20 000 КМ\r\n'),
(8, '6098cbe591672c0abc1086556cbdb1a5', 'РЕМОНТ ПНЕВМОБАЛЛОНОВ\r\nОТ 8 900 Р.\r\n'),
(9, '072cd34189a3f3ac72f06a11514660e0', 'ДИАГНОСТИКА\r\nБЕСПЛАТНО\r\n'),
(10, 'f0e39052fbcd60032414d89d1ca787d0', 'РЕМОНТ ВАРИАТОРОВ\r\nОТ 9 900 Р.\r\n'),
(15, 'bbb71695244fb2f2080d5e40ef210e3f', 'КАКИЕ ОСНОВНЫЕ СИМПТОМЫ НЕИСПРАВНОЙ АКПП?\r\nКАКИЕ ОСНОВНЫЕ СИМПТОМЫ НЕИСПРАВНОЙ КОРОБКИ?\r\nСИМПТОМОВ МНОЖЕСТВО: ВИБРАЦИИ ВО ВРЕМЯ ДВИЖЕНИЯ; СТУКИ В РАЙОНЕ РАСПОЛОЖЕНИЯ АКПП, ПРОПУСК ИЛИ ОТСУТСТВИЕ ОТДЕЛЬНЫХ ПЕРЕДАЧ, ПОЛНОЕ ОБЕЗДВИЖИВАНИЕ АВТОМОБИЛЯ, ЗАГОРАНИЕ КОНТРОЛЬНОЙ ЛАМПЫ НА ПРИБОРНОЙ ПАНЕЛИ.\r\n'),
