(46, '336ced206d291f8cbbcbee73c7aa793f', 'РАСЧЕТ РЕМОНТА\r\nРАССЧИТАЙТЕ\rПРЕДВАРИТЕЛЬНУЮ СТОИМОСТЬ НА САЙТЕ\r\n'),
(47, '2e52cfb1ebb82d4dd5ce255ad0ab6aef', 'ПРОВЕДЕНИЕ РЕМОНТА\r\nПРИЕЗД В ОДИН ИЗ \r356 БЛИЖАЙШИХ\rК ВАМ НАШИХ СЕРВИС ПАРТНЕРОВ ЛИБО САМОСТОЯТЕЛЬНАЯ ОТПРАВКА К НАМ НЕИСПРАВНОГО АГРЕГАТА\r\n'),
(48, 'de8a36b02c9ffab687f3fc90fb9a9498', 'О КОМПАНИИ\r\nАДРЕСА НАШИХ ПАРТНЕРОВ\rВЫБЕРИТЕ ВАШ ГОРОД ЧТОБЫ УВИДЕТЬ АДРЕСА СЕРВИСНЫХ ЦЕНТРОВ\rВЫБЕРИТЕ ОКРУГ\rВЫБЕРИТЕ РЕГИОН\rВЫБЕРИТЕ ГОРОД\rГ. КРАСНОДАР, УЛ. 1-ГО МАЯ, Д. 234, СЕРВИС “EAZYRIDE”\rГ. КРАСНОДАР, УЛ. 1-ГО МАЯ, Д. 234, СЕРВИС “EAZYRIDE”\rГ. КРАСНОДАР, УЛ. 1-ГО МАЯ, Д. 234, СЕРВИС “EAZYRIDE”\rГ. КРАСНОДАР, УЛ. 1-ГО МАЯ, Д. 234, СЕРВИС “EAZYRIDE”\r\n'),
(49, 'ec3caeab4414e31cb835a6ebd5291dda', 'О КОМПАНИИ\r\nЦЕЛЬ, “EAZYRIDE”\r- ИЗБАВИТЬ КЛИЕНТОВ ОТ ВСЕХ ЗАБОТ, СВЯЗАННЫХ СО СЛОЖНЫМ РЕМОНТОМ АВТОМОБИЛЬНЫХ АГРЕГАТОВ\r\n\rКОМПАНИЯ ОСНОВАНА В 2020 ГОДУ. ОСНОВНОЙ ЦЕЛЬЮ КОМПАНИИ ЯВЛЯЕТСЯ ОКАЗАНИЕ УСЛУГ ПО РЕМОНТУ АВТОМОБИЛЬНЫХ АГРЕГАТОВ ДЛЯ СУЩЕСТВУЮЩИХ АВТОСЕРВИСНЫХ ЦЕНТРОВ.\rВ КОМПАНИИ БОЛЕЕ 100 ЧЕЛОВЕК: ИНЖЕНЕРЫ ПО РЕМОНТУ, МЕНЕДЖЕРЫ ПО ПРОДАЖАМ И ВЕДЕНИЮ КЛИЕНТОВ, ПРОГРАММИСТЫ И МАРКЕТОЛОГИ. EAZYRIDE СЕЙЧАС АКТИВНО ПОДГОТАВЛИВАЕМ УЧЕБНУЮ БАЗУ ДЛЯ ОБУЧЕНИЯ НЕ ТОЛЬКО СВОИХ, НО И СТОРОННИХ СОТРУДНИКОВ.\r\n'),
(50, 'dd0584f0c7c4f2a7d7f85a13566e18ce', 'АВТОСЕРВИСАМ\r\n\r\n'),
(51, 'b2a7ae617fb85f8db6c5c37dd800aabc', 'АВТОСЕРВИСАМ\r\nПОЛУЧИТЕ\rБЕСПЛАТНО \rОТ НАС КЛИЕНТОВ\r\n\rПРЕДЛОЖЕНИЕ КОТОРОЕ НЕ ТРЕБУЕТ ОТ ВАС ВЛОЖЕНИЙ\rПРЕДЛОЖИТЕ НАШИ УСЛУГИ ВАШИМ КЛИЕНТАМ И \rПОЛУЧАЙТЕ ДОХОД\rРАБОТАЕМ ПО ВСЕЙ РОССИИ\r\n'),
(52, '6bac117baa8a010c961ad082a6e28293', 'РЕМОНТ АКПП\r\nРЕМОНТ АКПП, ВАРИАТОРОВ, ГИДРОБЛОКОВ И ТД. \rВАШ ДОХОД В ЗАВИСИМОСТИ ОТ СТОИМОСТИ РЕМОНТА\rДО 40%\r\n'),
(53, '4696e8393a609174c8e6cc4bbffed3b0', 'РЕМОНТ ПНЕВМОПОДВЕСКИ\r\nРЕМОНТ ПНЕВМОПОДВЕСКИ: ВОССТАНОВЛЕНИЕ БАЛЛОНОВ, СТОЕК, КОМПРЕССОРОВ И ТД.\rВАШ ДОХОД В ЗАВИСИМОСТИ ОТ СТОИМОСТИ РЕМОНТАУ\rДО 300 %\r\n'),
(54, 'c2073b6bb58b35527533b3f7a2542dc8', 'РЕМОНТ  РУЛЕВЫХ РЕЕК\r\nРЕМОНТ РУЛЕВЫХ РЕЕК\rА ТАКЖЕ НАШИ ЦЕНЫ ПОЗВОЛЯТ ВАМ СДЕЛАТЬ СВОЮ НАЦЕНКУ\rДО 100 %\r\n'),
(55, '37deb557bd9560ce5d37b1d13be723b3', 'РЕМОНТ ФОРСУНОК\r\nРЕМОНТ ФОРСУНОК\rВАШ ДОХОД В ЗАВИСИМОСТИ ОТ СТОИМОСТИ РЕМОНТА\rДО 150 %\r\n'),
(56, '373c8502c7145eb06a4fb3d35a6e87d2', 'РЕМОНТ  СТАРТЕРОВ, ГЕНЕРАТОРОВ\r\nКАЧЕСТВЕННЫЙ РЕМОНТ СТАРТЕРОВ И ГЕНЕРАТОРОВ \rВАШ ДОХОД В ЗАВИСИМОСТИ ОТ СТОИМОСТИ РЕМОНТА\rДО 250%\r\n'),
