(58, 'd63a17c72b3dc4f21ce159b172e036ed', 'РЕМОНТ ТУРБИН\r\nРЕМОНТ ТУРБИН ПОД КЛЮЧ И СОПУТСТВУЮЩИЕ УСЛУГИ ( ЗАМЕНА ВАЛА КОЛЕСА ТУРБОКОМПРЕССОРА И ТД) \rВАШ ДОХОД В ЗАВИСИМОСТИ ОТ СТОИМОСТИ РЕМОНТА\rДО 200 %\r\n'),
