(2753039, '5bd6d415202b6a21ba521e8b12884115', 'РЕМОНТ ПНЕВМОПОДВЕСКИ\r\nБЫСТРО И КАЧЕСТВЕННО ОТРЕМОНТИРУЕМ ПНЕВМОПОДВЕСКУ И ЕЕ ЭЛЕМЕНТЫ: ПНЕВМОБАЛЛОНЫ, ПНЕВМОСТОЙКИ, ПНЕВМОКОМПРЕССОРЫ И ГАЗО-МАСЛЯНЫЕ АМОРТИЗАТОРЫ.\r\nБЫСТРО И КАЧЕСТВЕННО ОТРЕМОНТИРУЕМ ПНЕВМОПОДВЕСКУ И ЕЕ ЭЛЕМЕНТЫ: ПНЕВМОБАЛЛОНЫ, ПНЕВМОСТОЙКИ, ПНЕВМОКОМПРЕССОРЫ И ГАЗО-МАСЛЯНЫЕ АМОРТИЗАТОРЫ. У НАС ИМЕЕТСЯ СВОЕ ПРОИЗВОДСТВО ПНЕВМОБАЛЛОНОВ И СТОЕК.  НА ВСЕ РАБОТЫ ДАЕМ СОБСТВЕННУЮ ГАРАНТИЮ.\r\n'),
(2753040, '94b7ad3b301ec3747a97788518d00628', 'РЕМОНТ ТУРБИН\r\nСЛОМАЛАСЬ ТУРБИНА? ЭТО ЕЩЕ НЕ ПОВОД ПОКУПАТЬ НОВУЮ, ЕСТЬ ВОЗМОЖНОСТЬ ОТРЕМОНТИРОВАТЬ И ВОССТАНОВИТЬ ТЕКУЩУЮ ТУРБИНУ СЭКОНОМЯ НА ЭТОМ ХОРОШИЕ ДЕНЬГИ. МЫ РЕМОНТИРУЕМ ТУРБИНЫ КАК ЛЕГКОВЫХ АВТОМОБИЛЕЙ ТАК И ГРУЗОВЫХ, КОММЕРЧЕСКИХ АВТОМОБИЛЕЙ.\r\r\nСЛОМАЛАСЬ ТУРБИНА? ЭТО ЕЩЕ НЕ ПОВОД ПОКУПАТЬ НОВУЮ, ЕСТЬ ВОЗМОЖНОСТЬ ОТРЕМОНТИРОВАТЬ И ВОССТАНОВИТЬ ТЕКУЩУЮ ТУРБИНУ СЭКОНОМЯ НА ЭТОМ ХОРОШИЕ ДЕНЬГИ. МЫ РЕМОНТИРУЕМ ТУРБИНЫ КАК ЛЕГКОВЫХ АВТОМОБИЛЕЙ ТАК И ГРУЗОВЫХ, КОММЕРЧЕСКИХ АВТОМОБИЛЕЙ. ДАННЫЙ ВИД РЕМОНТА ЗАНИМАЕТ НЕ БОЛЕЕ 1 ДНЯ. РАБОТЫ ВКЛЮЧАЮТ В СЕБЯ ДИАГНОСТИКУ И РЕМОНТ АГРЕГАТА.\r\n'),
(2753041, '52895d8f798ff8f4e14e5ddc0e24b0d3', 'РЕМОНТ  РУЛЕВЫХ РЕЕК\r\nЕСЛИ ВАС БЕСПОКОИТ СТУК В ПЕРЕДНЕЙ ПОДВЕСКЕ, ТЕЧЬ ИЗ ГИДРОУСИЛИТЕЛЯ И ТУГОЕ ВРАЩЕНИЯ РУЛЯ, ТО СКОРЕЕ ВСЕГО У ВАС НЕИСПРАВНА РУЛЕВАЯ РЕЙКА. МЫ ОСУЩЕСТВИМ РЕМОНТ И ВОССТАНОВЛЕНИЕ РУЛЕВОЙ РЕЙКИ И ДАДИМ ГАРАНТИЮ.\r\nЕСЛИ ВАС БЕСПОКОИТ СТУК В ПЕРЕДНЕЙ ПОДВЕСКЕ, ТЕЧЬ ИЗ ГИДРОУСИЛИТЕЛЯ И ТУГОЕ ВРАЩЕНИЯ РУЛЯ, ТО СКОРЕЕ ВСЕГО У ВАС НЕИСПРАВНА РУЛЕВАЯ РЕЙКА. МЫ ОСУЩЕСТВИМ РЕМОНТ И ВОССТАНОВЛЕНИЕ РУЛЕВОЙ РЕЙКИ И ДАДИМ ГАРАНТИЮ. ДЛЯ РЕМОНТА РЕЙКИ МЫ ИСПОЛЬЗУЕМ ТОЛЬКО КАЧЕСТВЕННЫЕ ЗАПАСНЫЕ ЧАСТИ. ВОССТАНОВЛЕННАЯ РУЛЕВАЯ РЕЙКА ПРОДЛИТ УДОВОЛЬСТВИЕ И БЕЗОПАСНОСТЬ ВОЖДЕНИЯ АВТОМОБИЛЯ НА ДОЛГИЙ СРОК.\r\n'),
(2753042, 'ce7ba52868dc8101d4608ddf8210292a', 'РЕМОНТ ФОРСУНОК\r\nОКАЖЕМ УСЛУГИ ПО РЕМОНТУ И ВОССТАНОВЛЕНИЮ ФОРСУНОК ЛЕГКОВЫХ И ГРУЗОВЫХ АВТО. НЕСПРАВНОСТЬ ФОРСУНОК МОЖЕТ ПРИВЕСТИ К КАПИТАЛЬНОМУ РЕМОНТУ ДИЗЕЛЬНОГО ДВИГАТЕЛЯ.\r\nОКАЖЕМ УСЛУГИ ПО РЕМОНТУ И ВОССТАНОВЛЕНИЮ ФОРСУНОК ЛЕГКОВЫХ И ГРУЗОВЫХ АВТО. НЕСПРАВНОСТЬ ФОРСУНОК МОЖЕТ ПРИВЕСТИ К КАПИТАЛЬНОМУ РЕМОНТУ ДИЗЕЛЬНОГО ДВИГАТЕЛЯ. ОСНОВНЫЕ ПРИЗНАКИ ПРОБЛЕМ С ФОРСУНКАМИ: ПОСТОРОННИЕ ШУМЫ В ДВИГАТЕЛЕ ; ЗАДЫМЛЕННОСТЬ, ПОТЕРЯ МОЩНОСТИ , ПОВЫШЕННЫЙ РАСХОД ТОПЛИВА.\r\n'),
(2753043, 'c31168ec1de391cb29b5e7af57fa17b7', 'РЕМОНТ  СТАРТЕРОВ / ГЕНЕРАТОРОВ\r\nПРОИЗВЕДЕМ КАЧЕСТВЕННЫЙ РЕМОНТ СТАРТЕРОВ И ГЕНЕРАТОРОВ. ИСПОЛЬЗУЕМ ТОЛЬКО НОВЫЕ ЗАПАСНЫЕ ЧАСТИ. \r\nПРОИЗВЕДЕМ КАЧЕСТВЕННЫЙ РЕМОНТ СТАРТЕРОВ И ГЕНЕРАТОРОВ. ИСПОЛЬЗУЕМ ТОЛЬКО НОВЫЕ ЗАПАСНЫЕ ЧАСТИ. НА ВСЕ РАБОТЫ ДАЕМ ГАРАНТИЮ\r\n'),
