(2753063, '3619aeea269b79b6687a32a03990ae55', 'КАКИЕ ОСНОВНЫЕ ПРОБЛЕМЫ МОГУТ БЫТЬ С ПНЕВМОПОДВЕСКОЙ?\r\nКАКИЕ ОСНОВНЫЕ ПРОБЛЕМЫ ПНЕВМОПОДВЕСКИ?\r\nУТЕЧКА ВОЗДУХА ИЗ ПНЕВМОБАЛЛОНОВ, СОЕДИНИТЕЛЬНЫХ ЭЛЕМЕНТОВ И ИЗНОС КОЛЕЦ ПНЕВМОКОМПРЕССОРА. 70% ВСЕХ ПОЛОМОК ПРИХОДИТСЯ НА НЕГЕРМЕТИЧНЫЕ ПНЕВМОБАЛЛОНЫ.\r\n'),
(2753064, 'cd7b29067d1f1fd4cedafce3cb3754fd', 'СКОЛЬКО ВРЕМЕНИ ЗАНИМАЕТ РЕМОНТ?\r\nСКОЛЬКО ВРЕМЕНИ ЗАНИМАЕТ РЕМОНТ ПНЕВМОПВЕСКИ?\r\nРЕМОНТ ЗАНИМАЕТ НЕ БОЛЕЕ 2-4 ЧАСОВ.\r\n'),
(2753065, '26c5a1623ff8e0673f92b667aeac0a12', 'КАКИЕ ОСНОВНЫЕ ПРОБЛЕМЫ МОГУТ БЫТЬ С ФОРСУНКАМИ?\r\nОСНОВНЫЕ ПРИЗНАКИ НЕИСПРАВНЫХ ФОРСУНОК\r\nНЕВОЗМОЖНОСТЬ ЗАПУСКА ДВИГАТЕЛЯ, ПОТЕРЯ МОЩНОСТИ, ДЕТОНАЦИЯ. УВЕЛИЧЕННЫЙ РАСХОД ТОПЛИВА. ЗАТЯГИВАНИЕ РЕМОНТА ЧРЕВАТО ДАЛЬНЕЙШИМ КАПИТАЛЬНЫМ РЕМОНТОВ ДВИГАТЕЛЯ.\r\n'),
(2753066, '6117a9ab1507267c3db91a2e02c0b508', 'СКОЛЬКО ПО ВРЕМЕНИ ЗАНИМАЕТ РЕМОНТ ФОРСУНОК?\r\nСКОЛЬКО ПО ВРЕМЕНИ ЗАНИМАЕТ РЕМОНТ ФОРСУНОК?\r\nОБЫЧНО ЭТО ВОССТАНОВЛЕНИЕ ЗАНИМАЕТ НЕСКОЛЬКО ЧАСОВ.\r\n');
